import Navbar from './components/Navbar';
import { BrowserRouter as Router, Routes } from 'react-router-dom'

 const App = () => {
  return (
    <>
    <Router>
      <Routes>
        <Route to = '/' element={<Navbar />}/>
      </Routes>
    </Router>

    </>
  )
}

export default App;
